import React from 'react';

export default function ShowRosters({rosters}) {
    return (
        <div className="show-rosters">
            {rosters.map((roster, rosterIndex) => (
                <div key={`roster-${rosterIndex}`}>
                    <h2>{roster.name}</h2>
                    {roster.roster.map((player, playerIndex) => (
                        <div key={`player-${playerIndex}`}>
                            <p>Position: {player.position}</p>
                            <p>Name: {player.name}</p>
                            <p>Trade Value: {player.tradeValue}</p>
                        </div>
                    ))}
                </div>
            ))}
        </div>
    );
}
